<!DOCTYPE html>
<html>
    <head>
        <title>iframe example</title>
        <script type="module" src="x-frame-bypass.js"></script>
        <iframe src="block-inline.html" frameborder="1" id="Inline" width="300" height="400"></iframe>
        <iframe src="https://youtube.com/embed/TTg8sEhVLrc" frameborder="0" width="300" height="150" style="visibility: visible;"></iframe>
        <iframe width="400" frameborder="0" marginheight="0" marginwidth="0" height="300" src="https://www.google.com/?igu=1"></iframe>
    </head>
    <body>
        <br/>
        <a href="https://youtu.be/TTg8sEhVLrc" target="_blank">Android Key Events (blank)</a><br/>
        <a href="https://youtu.be/TTg8sEhVLrc" target="_parent">Android Key Events (parent)</a><br>
        <a href="https://youtu.be/TTg8sEhVLrc" target="_self">Android Key Events (self)</a><br>
        <a href="https://youtu.be/TTg8sEhVLrc" target="_top">Android Key Events (top)</a>
    </body>

</html>
